function NavitemRight(props){
    return(
        <div><p class="c2"><a href={props.Ref}><svg xmlns="http://www.w3.org/2000/svg" width="38" height="38" viewBox="0 0 24 24"></svg></a></p><hr/></div>
    );
}

export default NavitemRight;
